import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <div className="footer">
      <div className="container">
        <div className="pt-4 d-flex flex-column align-items-center">
         <div>
           <h4>Important Links</h4>
           <ul>
            <li>Home</li>
            <li>Career</li>
            <li>Technology</li>
          </ul>
         </div>
         <div>
           <h4>Company</h4>
           <ul>
            <li>+372 53599795</li>
            <li><a href = "mailto: hello@btekc.co">hello@bteks.co</a></li>
            <li>Tallinn, Estonia</li>
          </ul>
         </div>
        </div>
          <p>Copyright @ 2020 <span className="text-info">Bteks</span></p>
      </div>
    </div>
  );
};


export default Footer;
